package com.springcontext.springcontext;

public class Cat {
	
	
	private String name;
	
	private Long handsomnes;

	public Cat() {
		// TODO Auto-generated constructor stub
	}

	public Cat(String name, Long handsomnes) {
		this.name = name;
		this.handsomnes = handsomnes;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public Long getHandsomnes() {
		return handsomnes;
	}

	public void setHandsomnes(Long handsomnes) {
		this.handsomnes = handsomnes;
	}
	
	
	
	

}
